import React, { useState } from 'react';
import './ModalLogin.css';

const ModalLogin = () => {
    const [modal, setModal] = useState(false);

    const toggleModal = () => {
        setModal()
    }

    return (
        <div>
            <button onClick={toggleModal} className='btnLoginModal'></button>
        </div>
    );
};

export default ModalLogin;
